import React from 'react';

const BookingForm = ({treatment,Date}) => {
    const {name,slots}= treatment;
    return (
        <div>
            <input type="checkbox" id="booking-modal" className="modal-toggle" />
            <div className="modal modal-bottom sm:modal-middle">
                <div className="modal-box">
                    <label htmlFor="booking-modal" className="btn btn-sm btn-circle absolute right-2 top-2">âœ•</label>
                    <h3 className="font-bold text-lg my-3 -mt-1 mb-5">{name}</h3>
                    <form onSubmit={()=>console.log(name)} className="space-y-4">
                        <input type="text" placeholder="Date" className="!bg-slate-200" value={Date} readOnly />

                        <input type="text" placeholder="Time" className="!bg-slate-200" value={slots[0]} readOnly/>

                        <input type="text" placeholder="Full Name"/>
                        <input type="tel" placeholder="Phone Number"/>
                        <input type="email" placeholder="Email"/>
                        <input type="text" />
                    </form>
                    <div className="modal-action">
                        <label htmlFor="booking-modal" className="btn">Yay!</label>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default BookingForm;
